„Jeigu kasdieniniu režimu naktimis miegame po 7-8 valandas, tai Dakare laukia dvi savaitės su 3-4 valandomis poilsio per parą. Mes važiuojame ne kaip turistai, tad iki vėlumos būsime su mechanikais bivuake ir stebėsime, kaip jie tvarko automobilius, o ankstyvą rytą pajudėsime į trasą, kad pamatytume kuo daugiau sportiniu režimu važiuojančių ekipažų“, – pasakoja vienas projekto #iGo2Dakar dalyvių  Mindaugas Plukys . Tai – ne pirma panaši M. Plukio kelionė. Artėjantis Dakaras – tarsi ištęstas „4x4 Perimetro“ maratonas, kuriame vyras su trimis kolegomis praėjusiais metais jau dalyvavo tokiu pačiu „ Nissan Navara “ automobiliu. Pikapas gali būti patogus miegui „ 4x4 Perimetras “ yra ilgiausias Lietuvos teritorijoje vykstantis ralio maratonas, besitęsiantis 2000 kilometrų šalies pasieniu – šį atstumą miško keliais ir bekelės ruožais sportininkai turi įveikti per 60 valandų. Jo metu, prisimena M. Plukys, laiko poilsiui nebuvo daug. „Per visas 60 valandų mes nevažiavome tik kokias septynias – tiek laiko pylėme degalus, valgėme, prausėmės ir miegojome. Visą kitą laiką važiavome. Panašus santykis tarp aktyvaus veikimo (vairavimo, fotografavimo ir filmavimo) bei poilsio laukia ir Pietų Amerikoje“, – sako M. Plukys, pridurdamas, jog dalyvavimas „4x4 Perimetre“ buvo bene geriausia įmanoma treniruotė prieš Dakarą. Varžybose, prisimena projekto #iGo2Dakar dalyvis, apie miegą palapinėse tekdavo pamiršti – per parą turint tris valandas laisvo laiko, nelabai norisi pusvalandį skirti palapinei sukonstruoti. Keturiems ekipažo nariams pakakdavo įlysti į miegmaišį ir nugriūti „Navara“ salone ar bagažinėje. „Jeigu pirmą parą kolegos dar spyriojosi, tai antrą jau buvo niekas nesvarbu. Jeigu nevairuoji ir nenaviguoji – reiškia, gali miegoti. Netrukdo net tai, jog esi sėdimoje pozicijoje, o duobės kartais tokios, jog pašoki aukštai ir tik prisegtas saugos diržas apsaugo nuo smūgio į stogą“, – pasakoja keliautojas. Dakaro išbandymui #iGo2Dakar dalyviai pasiruošė geriau. Ekipažo mantoje atsidūrė ne tik specialūs žemai temperatūrai pritaikyti miegmaišiai, bet ir akimirksniu išsiskleidžiančios palapinės. M. Plukys netgi atliko eksperimentą: nuo pakuotės paėmimo į rankas iki atsigulimo tokioje palapinėje jis užtruko 20 sekundžių. Šis bandymas taip pat užfiksuotas trumpame video: (function(d, s, i, r) {
